import uuid from 'uuid/v1';
import axios from 'axios'

import AxiosMockAdapter from 'axios-mock-adapter';
import React from "react";

const instance = new AxiosMockAdapter(axios, { delayResponse: 0 });


instance.onGet('/pizza/all').reply(200, {
    veg: [
        {
            id: uuid(),
            name: 'Batman Pizza',
            crust: 'Thin',
            cheese: 'Burst',
            price: '300.00',
            image: "/pizzaveg1.jpg"
        },
        {
            id: uuid(),
            name: 'Iron Man Pizza',
            crust: 'Regular',
            cheese: 'Burst',
            price: '500.00',
            image: "/pizzaveg1.jpg"
        },
    ]
});
